// LikedPage.js
import React from 'react';
import Cardd from './cardd';

const LikedPage = ({ likedCards }) => {
    return (
        <div>
            <h1>Liked Cards</h1>
            {likedCards.map((card, index) => (
                <Cardd
                    key={index}
                    src={card.src}
                    title={card.title}
                    description={card.description}
                    price={card.price}
                    date={card.date}
                    location={card.location}
                />
            ))}
        </div>
    );
};

export default LikedPage;
